import classNames from 'classnames';
import waves from '../../mixins/waves';
import mdbIcon from '../Content/Fa';
import mdbClassMixin from '../../mixins/mdbClassMixin';

const Btn =  {
  components: {
    mdbIcon
  },
  props: {
    tag: {
      type: String,
      default: "button"
    },
    color: {
      type: String,
      default: 'default'
    },
    outline: {
      type: String,
    },
    size: {
      type: String
    },
    block: {
      type: Boolean,
      default: false
    },
    role: {
      type: String
    },
    type: {
      type: String
    },
    active: {
      type: Boolean,
      default: false
    },
    disabled: {
      type: Boolean,
      default: false
    },
    icon: {
      type: String
    },
    iconLeft: {
      type: Boolean,
      default: false
    },
    iconRight: {
      type: Boolean,
      default: false
    },
    waves: {
      type: Boolean,
      default: true
    },
    gradient: {
      type: String
    },
    rounded: {
      type: Boolean,
      default: false
    },
    floating: {
      type: Boolean,
      default: false
    },
    flat: {
      type: Boolean,
      default: false
    },
    action: {
      type: Boolean,
      default: false
    },
    transparent: {
      type: Boolean,
      default: false
    },
    save: {
      type: Boolean,
      default: false
    },
    iconClass: {
      type: [String, Array],
      default: null
    },
    iconColor: {
      type: String
    },
    far: {
      type: Boolean,
      default: false
    },
    regular: {
      type: Boolean,
      default: false
    },
    fal: {
      type: Boolean,
      default: false
    },
    light: {
      type: Boolean,
      default: false
    },
    fab: {
      type: Boolean,
      default: false
    },
    brands: {
      type: Boolean,
      default: false
    },
    fad: {
      type: Boolean,
      default: false
    },
    group: {
      type: Boolean,
      default: false
    },
    text: {
      type: String
    }
  },
  methods: {
    handleClick(e) {
      this.wave(e);
      this.$emit('click', this);
    }
  },
  computed: {
    btnClasses() {
      return classNames(
        this.floating ? 'btn-floating' : 'btn',
        this.outline ? 'btn-outline-' + this.outline : this.flat ? 'btn-flat' : this.transparent ? '' : 'btn-' + this.color,
        this.size && 'btn-' + this.size,
        this.block && 'btn-block',
        this.disabled && 'disabled',
        this.gradient && this.gradient + '-gradient',
        this.rounded && 'btn-rounded',
        this.action && 'btn-action',
        this.save && 'btn-save',
        this.active && 'active',
        this.waves && 'ripple-parent',
        this.group && 'm-0 px-3 py-2',
        (this.group && this.outline) && 'z-depth-0',
        this.text && `${this.text}-text`,
        this.mdbClass
      );
    },
    iconClasses() {
      return classNames(
        'px-1',
        this.iconClass
      );
    }
  },
  mixins: [waves, mdbClassMixin]
};

export default Btn;
export { Btn as mdbBtn };
